import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './components/Header';
import Footer from './components/Footer';
import './Home.css';


class Home extends Component {
    render() {
      return (
        <>
          <Header />
          <br></br>

      <div id="Container">
        <div id="body-content">
        <MainContent/>
        </div>
      </div>

        <div>
    <div class="section">
        <input type="radio" name="slide" id="slide01" checked></input>
        <input type="radio" name="slide" id="slide02"></input>
        <input type="radio" name="slide" id="slide03"></input>

        <div class="slidewrap">
            <ul class="slidelist">
                <li>
                    <a>
                        <label for="slide03" className="left">
                        <img src="img/4.png" style={{
                          width: "60px", height: "60px",
                        }}></img>
                        </label>
                        <img src="img/1.jpg"></img>
                        <label for="slide02" className="right">
                        <img src="img/5.png" style={{
                          width: "60px", height: "60px",
                        }}></img>
                        </label>
                    </a>
                </li>
                <li>
                    <a>
                        <label for="slide01" className="left">
                          <img src="img/4.png" style={{
                          width: "60px", height: "60px",
                        }}></img>
                        </label>
                        <img src="img/2.jpg"></img>
                        <label for="slide03" className="right">
                        <img src="img/5.png" style={{
                          width: "60px", height: "60px",
                        }}></img>
                        </label>
                    </a>
                </li>
                <li>
                    <a>
                        <label for="slide02" className="left">
                        <img src="img/4.png" style={{
                          width: "60px", height: "60px",
                        }}></img>
                        </label>
                        <img src="img/3.jpg"></img>
                        <label for="slide01" className="right" >
                        <img src="img/5.png" style={{
                          width: "60px", height: "60px",
                        }}></img>
                        </label>
                    </a>
                </li>
            </ul>
        </div>
    </div>

    </div>
          <Footer />
        </>
      );
    }
  }
             
  export default Home;
